import React from 'react';
import { Link } from 'react-router-dom';
import "./Welcome.css"
import RecentlyWatchedMovie from './RecentlyWatchedMovie';

const Welcome = () => {

    return (
        <div>
            <div>
                <div id="vertical-flip" class="welcomecard">
                    <div class="container">
                        <img class="imglogo" src="https://fontmeme.com/permalink/210115/72a4a804c01a2fa22cb39362f6132c1d.png" alt="PickFlix" />
                        <Link to="/login">
                            <button variant="contained" class="logobutton" >Enter</button>
                        </Link>
                    </div>
                </div>
            </div>
            <RecentlyWatchedMovie/>
        </div>
    )

};

export default Welcome;
